      <ul className={styles.navBack}>
        <li className={styles.nav}>
          <Link href="/">
            <span className={styles.navText}>home</span>
          </Link>
        </li>
        <li className={styles.nav}>
          {signInfo.kakaoId === "" ? (
            <Link href="/signin">
              <span className={styles.navText}>로그인</span>
            </Link>
          ) : (
            <Link href="/">
              <span className={styles.navText}>로그아웃</span>
            </Link>
          )}
        </li>
        <li className={styles.nav}>
          <Link href="/simple">
            <span className={styles.navText}>로그아웃</span>
          </Link>
        </li>
      </ul>
    </div>
  );
});

